import{_ as a,o as t,c as i,a3 as o}from"./chunks/framework.DyVDm1WL.js";const b=JSON.parse('{"title":"特定問題排查步驟","description":"","frontmatter":{},"headers":[],"relativePath":"zh/start/problem_specific_check.md","filePath":"zh/start/problem_specific_check.md"}'),r={name:"zh/start/problem_specific_check.md"};function e(s,l,p,c,g,h){return t(),i("div",null,[...l[0]||(l[0]=[o('<h1 id="特定問題排查步驟" tabindex="-1">特定問題排查步驟 <a class="header-anchor" href="#特定問題排查步驟" aria-label="Permalink to &quot;特定問題排查步驟&quot;">​</a></h1><h2 id="_1-指紋瀏覽器無法啟動" tabindex="-1">1. 指紋瀏覽器無法啟動 <a class="header-anchor" href="#_1-指紋瀏覽器無法啟動" aria-label="Permalink to &quot;1. 指紋瀏覽器無法啟動&quot;">​</a></h2><p>一般常見於您同一個賬號登入了多臺電腦，比如A，B兩臺，A電腦上您建立了一個指紋環境P1，接著您再B電腦上登入了賬號，嘗試啟動指紋環境P1，此時如果A電腦沒有啟動客戶端，B電腦上啟動指紋環境P1會報錯。</p><p>要解決這個問題有下面兩種方法</p><ul><li>A電腦開機，並啟動客戶端</li><li>在B電腦上開啟客戶端，將指紋環境P1批次遷移到本地</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/qy01.png" alt="遷移指紋環境" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/qy02.png" alt="遷移指紋環境" loading="lazy"></p><p>為了避免這種問題，請儘可能在同一臺電腦上使用</p><h2 id="_2-指紋瀏覽器任務長時間不執行" tabindex="-1">2. 指紋瀏覽器任務長時間不執行 <a class="header-anchor" href="#_2-指紋瀏覽器任務長時間不執行" aria-label="Permalink to &quot;2. 指紋瀏覽器任務長時間不執行&quot;">​</a></h2><blockquote><p>當前建立任務後，任務開關會自動開啟，如果發現還是長時間不會執行，請按照如下步驟檢查</p></blockquote><ul><li>找到對應的指紋裝置，在控制介面的頂部導航點選<strong>任務[RPA]</strong>，看一下是不是沒有到執行時間。</li><li>嘗試一下手動啟動指紋瀏覽器，看能否正常啟動，無法正常啟動，請參考<a href="./problem_specific_check.html#_1-指紋瀏覽器無法啟動">指紋瀏覽器無法啟動</a>，<strong>注意手動啟動後，請開啟任務執行開關，後續的自動化任務才會執行</strong></li><li>找到對應的指紋裝置，在控制介面的頂部導航點選<strong>任務[RPA]</strong>，是否有其它排在之前的任務還沒執行完(可以停止之前的任務)。</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/noexec01.png" alt="任務長時間不執行" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/noexec02.png" alt="任務長時間不執行" loading="lazy"></p><h2 id="_3-手機上任務長時間不執行" tabindex="-1">3. 手機上任務長時間不執行 <a class="header-anchor" href="#_3-手機上任務長時間不執行" aria-label="Permalink to &quot;3. 手機上任務長時間不執行&quot;">​</a></h2><ul><li>檢視一下手機上的XROBOT APP是否正常啟動，並且登入連結正常（如果您修改了您賬號的密碼，XROBOT需要重新登入，不然無法正常連結），連結不正常可嘗試重新登入，或者檢查一下可繫結的裝置數是不是滿了</li><li>如果您中途更換電腦，嘗試重新繫結裝置管理器</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/resetPhoneManager01.png" alt="重置手機的裝置管理器" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/resetPhoneManager02.png" alt="重置手機的裝置管理器" loading="lazy"></p><ul><li>如果您使用的是盒子模擬的手機，因為同一個機位下只能一個手機啟動執行任務，請檢查一下是否是同機位下其它手機有任務還沒執行完，如執行完會自動輪流其它的手機執行任務。</li><li>類似指紋瀏覽器，可能該手機還有其他任務沒有執行完或者是建立的任務還沒到執行時間，和指紋瀏覽器一樣，開啟該裝置的任務列表，確認此情況。</li></ul><h2 id="_4-帶附件的發帖-發私信任務執行失敗" tabindex="-1">4. 帶附件的發帖/發私信任務執行失敗 <a class="header-anchor" href="#_4-帶附件的發帖-發私信任務執行失敗" aria-label="Permalink to &quot;4. 帶附件的發帖/發私信任務執行失敗&quot;">​</a></h2><ul><li>確保上傳的檔案沒有同步雲端，因為如果同步雲端可能需要從雲端下載，如果您網路比較慢或者檔案比較大，容易超時失敗，如果之前不小心同步雲端，請刪除之前的附件，重新上傳，重新建立任務。 <img src="https://spub.xrobot.tech/blog/src/img/up01.png" alt="檔案上傳" loading="lazy"></li><li>如果您是在手機上執行任務，請確保手機與您當前電腦內網互通，如果不知道如何判斷是否互通，請直接嘗試點選下圖所展示區域，輪流切換內網IP，切換後，重啟失敗任務試試看。 <img src="https://spub.xrobot.tech/blog/src/img/aip01.png" alt="切換內網IP" loading="lazy"></li></ul><h2 id="_5-客戶端連線不上盒子" tabindex="-1">5. 客戶端連線不上盒子 <a class="header-anchor" href="#_5-客戶端連線不上盒子" aria-label="Permalink to &quot;5. 客戶端連線不上盒子&quot;">​</a></h2><ul><li>盒子必須和客戶端所在電腦位於同一個區域網</li><li>客戶端繫結的盒子IP需要和盒子IP一致，並且盒子需要處於開機狀態</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/boxip01.png" alt="盒子IP" loading="lazy"></p><ul><li>魔雲騰必須安裝超級SDK外掛</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/sdk01.png" alt="盒子IP" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/sdk02.png" alt="盒子IP" loading="lazy"></p><h2 id="_6-盒子模擬的手機無法正常顯示介面" tabindex="-1">6. 盒子模擬的手機無法正常顯示介面 <a class="header-anchor" href="#_6-盒子模擬的手機無法正常顯示介面" aria-label="Permalink to &quot;6. 盒子模擬的手機無法正常顯示介面&quot;">​</a></h2><ul><li>檢查一下盒子是否開機並連線內網，如果均正常，請嘗試斷電重啟盒子5分鐘後檢視。</li><li>依然異常，請開啟魔雲騰官方客戶端，看一下機位是否到期了，如果到期請續期一下，5分鐘後再觀察。</li><li>依然異常，請檢查一下系統繫結的手機的ip和魔雲騰顯示的ip是否一致，如果不一致請嘗試批次修改繫結的IP，和魔雲騰顯示的ip一致。</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/rip01.png" alt="切換內網IP" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/rip02.png" alt="切換內網IP" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/rip03.png" alt="切換內網IP" loading="lazy"></p>',31)])])}const u=a(r,[["render",e]]);export{b as __pageData,u as default};
